import Card from 'react-bootstrap/Card';

const Link = props => {
    var text;
    if(props.text) {
        text = props.text;
    } else {
        text = props.url;
    }
    return (
        <Card bg="warning" key="1" text="black" style={{ width: '18rem' }} className="">
            <Card.Body>
                <Card.Link href={props.url}>{text}</Card.Link>
            </Card.Body>
        </Card>)
}

export default Link;
